Let's say you wanted to console.log a Rust string: unsafe extern "C" { fn console_log_string(s: *const u8, len: usize);
} fn main() { let s = "Hello, world!"; unsafe { console_log_string(s.as_ptr(), s.len()); }
} On the javascript side, you would define console_log_string: <!DOCTYPE html>
<html lang="en">
<head> <meta charset="UTF-8"> <meta name="viewport" content="width=device-width, initial-scale=1.0"> <title>Document</title>
</head>
<body> <script> window.onload = async () => { const response = await fetch("./target/wasm32-unknown-unknown/debug/blog.wasm"); const { instance } = await WebAssembly.instantiateStreaming(response, { env: { console_log_string: (ptr, len) => { const memory = new Uint8Array(instance.exports.memory.buffer, ptr, len); // Typically you would instantiate your TextDecoder once instead of with every call const string = new TextDecoder('utf-8').decode(memory); console.log(string); } } }); instance.exports.main(); }; </script>
</body>
</html> When targeting a javascript runtime you would just do away with the html part and window.onload. The wasip1 model is practically the same, with a slight difference in that you would pass a wasi_snapshot_preview1 object alongside env. An npm library that I would recommend is @bjorn3/browser_wasi_shim : let wasi = new WASI([], [], []); const response = await fetch("./target/wasm32-wasip1/debug/blog.wasm"); const { instance } = await WebAssembly.instantiateStreaming(response, { wasi_snapshot_preview1: wasi.wasiImport env: { console_log_string: (ptr, len) => { const memory = new Uint8Array(instance.exports.memory.buffer, ptr, len); const string = new TextDecoder('utf-8').decode(memory); console.log(string); } } }); Similarly with emscripten, you would typically define the function in your C/C++ source code using the EM_JS macro: EM_JS(void, console_log_string, (const char *ptr, size_t len), { const str = UTF8ToString(ptr, len); console.log(str); }); You can also pass the definition of console_log_string if you build with the shell option -sMODULARIZE: import initModule from "./bin/main.mjs"; window.onload = async () => { const mymain = await initModule({ console_log_string: /* definition goes here */ }); };

