Now when it comes to wasip2, unless you pass the --skip-wit-component flag to the linker (wasm-component-ld), you would end up with a wasm component. So how can we declare our console_log_string function for usage within Rust, and how can we define it in javascript. Well we will have to do it in WIT. Luckily for simple cases, you can use a macro wit_bindgen::generate! if you add wit-bindgen as a dependency to your project. And since we're building a runnable program, we'll also use the wasip2 crate: [package]
name = "blog"
version = "0.1.0"
edition = "2024" [lib]
crate-type = ["cdylib"] [dependencies]
wit-bindgen = "0.44"
wasip2 = "1" For C/C++ code, you would have to run wit-bindgen manually or as part of your build via CMake for example. It will generate a header, source file and an object file! These should be added to your build, unless you're creating a library, in which case the object file should be exposed as a target (in CMake parlance!), otherwise you risk losing it in the final link step. That's actually easier than telling your dependents to manually pass --whole-archive/--no-whole-archive to the linker. Exposing the object as a target can be easily done in CMake: # code from the library I'm working on! # can be used by consumers using target_link_libraries(myapp PRIVATE emcore::component_type) install(FILES ${CMAKE_CURRENT_LIST_DIR}/src/env_component_type.o DESTINATION ${CMAKE_INSTALL_LIBDIR}) add_library(emcore_component_type INTERFACE) target_link_libraries(emcore_component_type INTERFACE "$<BUILD_INTERFACE:${CMAKE_CURRENT_LIST_DIR}/src/env_component_type.o>" "$<INSTALL_INTERFACE:${CMAKE_INSTALL_LIBDIR}/env_component_type.o>" ) add_library(emcore::component_type ALIAS emcore_component_type) install(TARGETS emcore_component_type EXPORT emcoreTargets) Back to Rust, notice in the above Cargo.toml how we change this from an executable binary to a cdylib. That's because runnable wasip2 components (or those using the -mexec-model=command in C/C++), would define a wasi:cli/run interface: wit_bindgen::generate!({inline: "
package my:app@0.1.0; interface logger { console-log-string: func(s: string);
} world app { import logger;
}
"}); struct App; impl wasip2::exports::cli::run::Guest for App { fn run() -> Result<(), ()> { crate::my::app::logger::console_log_string("Hello, world!"); Ok(()) }
} wasip2::cli::command::export!(App); Since browsers don't support wasip2 as of yet, we can use jco by the bytecodealliance org to generate the necessary core modules and javascript glue code. After installing jco, we run the transpile command: npm i --save-dev @bytecodealliance/jco
npx jco transpile ./target/wasm32-wasip2/release/blog.wasm -O -o bin/app --instantiation async --no-nodejs-compat --tla-compat --no-typescript The -O flag tells jco to optimize the generated wasm modules. This might not be necessary for Rust wasm components, however if you try to generate C/C++ wasm components in Release mode, you'll be hit with an error. Basically binaryen can't read the wasm component format: [parse exception: this looks like a wasm component, which Binaryen does not support yet (see https://github.com/WebAssembly/binaryen/issues/6728) (at 0:8)]
Fatal: error parsing wasm (try --debug for more info) More on that later! The transpile step will generate a directory bin/app with the generated core wasm modules and js glue files. We can then instantiate the generated wasm modules, then pass our definition of console-log-string as part of my:app/logger interface: import { WASIShim } from "@bytecodealliance/preview2-shim/instantiation";
// generated by jco
import { instantiate as initApp } from "../bin/app/blog.js"; async function main() { const getAppCore = async (p) => { const bytes = await fetch( new URL(`../bin/app/${p}`, import.meta.url) ); return WebAssembly.compileStreaming(bytes); }; const wasiShim = new WASIShim({}); const wasi = wasiShim.getImportObject(); const app = await initApp(getAppCore, { ...wasi, "my:app/logger": { consoleLogString: (s) => { console.log(s); }, }, }); app.run.run();
} await main(); The above code requires a bundler like webpack to resolve the node_modules paths etc.

