With the component model, we would simply define the function and export it: wit_bindgen::generate!({inline: "
package my:app@0.1.0; interface greeter { greet: func(s: string) -> string;
} world app { export greeter;
}
"}); struct App; impl crate::exports::my::app::greeter::Guest for App { fn greet(s: String) -> String { format!("Hello, {}!", s) }
} export!(App); And we can use it from our javascript: import { WASIShim } from "@bytecodealliance/preview2-shim/instantiation";
// generated by jco
import { instantiate as initApp } from "../bin/app/blog.js"; async function main() { const getAppCore = async (p) => { const bytes = await fetch( new URL(`../bin/app/${p}`, import.meta.url) ); return WebAssembly.compileStreaming(bytes); }; const wasiShim = new WASIShim({}); const wasi = wasiShim.getImportObject(); const app = await initApp(getAppCore, { ...wasi, }); console.log(app.greeter.greet("World!"));
} await main(); Actually even the instantiation code is simpler since we don't import any javascript exports, but I went for the manual instiation code for symmetry with the previous section! For example if you don't pass --instantion: # no --instantiation
npx jco transpile ./target/wasm32-wasip2/release/blog.wasm -O -o bin/app --no-nodejs-compat --tla-compat --no-typescript You would load using: import { $init, greeter } from "../bin/app/blog.js"; async function main() { await $init; console.log(greeter.greet("World!"));
} await main();

